import React from "react";
import Button from '@material/react-button';

import './Start.scss';

import logoColor from '../assets/aprendiCODEColor.png';


export class Start extends React.Component {
    render() {
        return (
            <div className="home">
                <div className="middle">
                    <div className="start-cards">
                        <div className="start-card selected card1"></div>
                        <div className="start-card card2"></div>
                        <div className="start-card card3"></div>
                        <div className="start-card card4"></div>
                        <div className="start-card card5"></div>
                        <div className="start-card card6"></div>
                    </div>
                </div>
            </div>
        );
    }
}
